const img = ""

func TestCvs(t *testing.T) {
	logger.Init(context.Background(),
		logger.WithGlobalConfigs(&configs.LoggerConfigs{
			Level:    "debug",
			Encoding: "console",
		}))
	recg, err := face.NewRecognizer("../../../models")
	if err != nil {
		t.Error(err)
	}
	cvs := service.NewComputerVisionService(nil, recg)
	resp, err := cvs.Detect(context.Background(),
		&service.DetectRequest{
			Base64Image: img,
		})
	if err != nil {
		t.Error(err)
	}
	log.Println(resp)
}

